package sampletest;

public class Names {
	private String apple;
	private String appleX;
	private String samsung;
	private String redmi;
	private String microsoft;
	public Names() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Names(String apple, String appleX, String samsung, String redmi, String microsoft) {
		super();
		this.apple = apple;
		this.appleX = appleX;
		this.samsung = samsung;
		this.redmi = redmi;
		this.microsoft = microsoft;
	}
	public String getApple() {
		return apple;
	}
	public void setApple(String apple) {
		this.apple = apple;
	}
	public String getAppleX() {
		return appleX;
	}
	public void setAppleX(String appleX) {
		this.appleX = appleX;
	}
	public String getSamsung() {
		return samsung;
	}
	public void setSamsung(String samsung) {
		this.samsung = samsung;
	}
	public String getRedmi() {
		return redmi;
	}
	public void setRedmi(String redmi) {
		this.redmi = redmi;
	}
	public String getMicrosoft() {
		return microsoft;
	}
	public void setMicrosoft(String microsoft) {
		this.microsoft = microsoft;
	}
	
}
